import React from "react";

const Footer = () => {
  return (
    <>
      <div className="social-icons">
        <i class="fa-brands fa-github"></i>
        <img src="../images/linkedin.png" />
        <i class="fa-brands fa-square-github"></i>
        <i class="fa-brands fa-linkedin"></i>
      </div>
    </>
  );
};

export default Footer;
